CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_ingresar_usuario`(vnombres VARCHAR(200), 
vapellidos VARCHAR(200), vcedula VARCHAR(10), 
vedad VARCHAR(3), vemail VARCHAR(45), 
vlugar VARCHAR(50), vid_tipoUsuario INT, vusuario VARCHAR(100),
vcontrasena VARCHAR(100))
BEGIN
	declare vid_persona int;
	declare vid_usuario int;
	
Insert into persona(nombres,apellidos,cedula,edad,email,lugar,estado)
				values(vnombres,vapellidos,vcedula,vedad,vemail,vlugar,'A');
	set vid_persona=(select max(id_persona) from persona where estado='A');
	
Insert into usuario(id_tipoUsuario,id_persona,estado)
				values(vid_tipoUsuario,vid_persona,'A');

	set vid_usuario=(select max(id_usuario) from usuario where estado='A');
	
Insert into datousuario(id_usuario,usuario,contrasena,estado)
				values(vid_usuario,vusuario,vcontrasena,'A');
END ;;
DELIMITER ;
