CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_modulo_usuarios`(
v_id_persona int,
v_nombres varchar(200),
v_apellidos varchar(200),
v_cedula varchar(10),
v_edad varchar(3),
v_email varchar(100),
v_lugar varchar(100),
v_idtipoUsuario int,
v_alias varchar(50),
v_dpassword varchar(100),
accion int)
BEGIN
declare v_id_usuario int;	
IF accion=1 THEN
		Update persona set id_persona=v_id_persona,
				    nombres=v_nombres,
					apellidos=v_apellidos,
   				    cedula=v_cedula,
					edad=v_edad,
                    email=v_email,
				 	lugar=v_lugar
		    		where id_persona=v_id_persona and estado='A';

  set v_id_usuario=(select id_usuario from usuario where id_persona=v_id_persona and estado='A');
	
		Update usuario set id_usuario =v_id_usuario,
id_tipoUsuario=v_idtipoUsuario where estado='A' and id_persona=v_id_persona;

Update datousuario set usuario=v_alias,
			                contrasena=v_dpassword
                   where id_usuario=(select id_usuario from usuario where id_persona=v_id_persona and estado='A') and estado='A';

	ELSE
		Update persona set estado='I' where id_persona=v_id_persona;
		Update usuario set estado='I' where id_persona=v_id_persona;
		update datousuario set estado='I' where id_usuario=(select id_usuario from usuario where id_persona=v_id_persona);
	END IF;
END ;;
DELIMITER ;
